    <header><nav><a href="/index.html">Minh Ton</a> <a href="/projects.html">Projects</a> <a href="/services/web/index.html">Web Development Services</a></nav></header><main><section><h1>Academic Lab Management System</h1><p>3 Week | Solo Project | Completed<p>A comprehensive solution designed to automate the management of computer labs, software, schedules, and issue reporting. This project demonstrates my expertise in building applications with complex relational database design, role-based access control, an intuitive user interface, and seamless Excel import/export integration – delivering efficiency and scalability for schools and training centers.</p><a href="/services/web/index.html">Contact to build a similar website</a></section><section><h2>Project Overview</h2><p>This is a web application developed to improve how schools and training centers manage their computer labs. The system centralizes key operations such as lab resources, software, users, and academic schedules into a single platform.<p>A core feature of the project is its timetable scheduling function, which supports multiple semesters, classes, and subjects. The system helps avoid conflicts between teachers, rooms, and classes while also checking lab requirements like computer capacity and subject-specific software. It enforces subject rules such as credits and weekly session limits, ensuring schedules remain consistent with training center regulations.<p>The project is built on a relational database with complex relationships that connect labs, subjects, users, and schedules. It also includes role-based access control (Admin – Teacher – Student), an Excel import/export utility for subjects, and an intuitive interface with calendar-based schedules and a dashboard for quick insights.<p>This project highlights skills in database design, role-based system development, and user-focused UI/UX, while addressing real-world scheduling and resource management challenges.</section><section><h2>Key Features</h2><ul><li>User authentication and authorization<li>View and update personal profile information<li>Change password securely<li>Manage accessories, software, labs, computers, departments, and subjects<li>Import and export subjects via Excel<li>Create, edit, and manage class schedules<li>Handle schedule requests and computer error reports efficiently<li>Dashboard with statistics and insights<li>User and semester management with full control<li>Request new teaching schedules with ease<li>Report computer issues instantly<li>View assigned classrooms and teaching schedules<li>Track submitted schedule requests and error reports</ul></section><section><h2>Challenges & Solutions</h2><h3>Challenge: Complex Business-rule Timetable Scheduling</h3><p>Managing highly relational entities such as labs, computers, electronic components, software, departments, subjects, and semester schedules.<p>Ensuring non-conflicting schedules across teachers, rooms, and classes while verifying that each lab meets software requirements and has enough computers for all students.<p>Enforcing academic rules: each subject has fixed credits and weekly session limits, so the system must prevent over-scheduling while aligning with semester structures.<p><strong>Solution:</strong> Designed a normalized relational database schema linking labs, software, departments, and subjects with credit and weekly session constraints. Implemented validation logic to check software availability, machine capacity, and student counts before assigning schedules. Built a conflict-detection engine to automatically prevent overlaps between teachers, classes, and labs. Applied rules to restrict timetable creation so that subjects never exceed their defined weekly session limits. Developed a user-friendly calendar-based UI that visualizes class periods, credits, and weekly allocations for easy management. Added admin control tools for overriding, cancelling, or adjusting schedules while still respecting academic regulations.<h3>Challenge: Centralized Issue Tracking & Resolution</h3><p>When incidents occur (e.g., labs, computers, or software not meeting requirements), the system must log, categorize, and ensure quick resolution to avoid disrupting academic activities.<p><strong>Solution:</strong> Integrated a request management module with workflow statuses. Provided admin and teacher interfaces to respond, track progress, and maintain transparency during issue resolution.<h3>Challenge: Monitoring Dashboard</h3><p>The system must continuously track request statuses and provide statistics, while also monitoring labrooms, labroom issues request, and active users.<p><strong>Solution:</strong> Designed an intuitive dashboard with counters and charts to help administrators easily monitor workload and resource utilization.<h3>Challenge: Excel Data Processing</h3><p>Supporting seamless import/export of subjects and schedules without data corruption.<p><strong>Solution:</strong> Integrated Excel parsing libraries with validation and error-handling, ensuring smooth data transfer and consistency.</section><section><h2>Project Highlights</h2><p><strong>Unified lab and computer management</strong>: Integrated labs, computers, accessories, and software into a single platform. Administrators can manage all resources seamlessly, reducing manual effort and improving efficiency.<p><strong>Smart scheduling and tracking</strong>: Developed a scheduling system that allows admins to create and edit class timetables, while teachers can submit requests and track approvals in real time.<p><strong>Instant issue reporting</strong>: Teachers can report computer errors instantly, and admins can monitor and resolve them efficiently. This ensures uninterrupted teaching sessions and stable lab performance.<p><strong>Monitoring Dashboard</strong>: Provides admins with live statistics on requests, active users, and lab availability. Includes visual charts and summary cards for quick decision-making and system health monitoring.<p><strong>Seamless Excel integration</strong>: Implemented Excel import/export for subjects and schedules. Bulk data processing is accurate, fast, and saving time of manual work for administrators.<p><strong>Enhanced User Experience & Accessibility</strong>: Designed a calendar-based timetable interface for intuitive schedule management. Role-based access control ensures users only see and interact with the features relevant to them, improving both security and usability.</section><section><h2>Project Info</h2><p>Category: Web Application<p>My Role: Full-Stack Developer<p>Duration: 3 Week<p>Team Size: Solo Project<p>Technologies: Java JSP, Spring Boot, Spring Data JPA, Html, Css, Js, MySQL<p>Quick Stats: 3 Week, 100% Solo, Roles: Admin, Teacher, User, Complex Relational Database, Advanced Scheduling Logic, Excel Import/Export, Responsive UI/UX</section><section><h2>Related Projects</h2><p><a href="/webs/fb-marketplace.html">Facebook Account Marketplace</a>: Website<p><a href="/webs/robux-marketplace.html">Robux Marketplace</a>: Website</section><section><h2>Project Images</h2><ul><li><img alt="Screenshot Dashboard"src="/imgs/labroom_management/dashboard.webp"><li><img alt="Screenshot Login Page"src="/imgs/labroom_management/login-page.webp"><li><img alt="Screenshot Schedules"src="/imgs/labroom_management/schedules.webp"><li><img alt="Screenshot Choose Labroom"src="/imgs/labroom_management/choose-labroom.webp"><li><img alt="Screenshot Edit Schedule"src="/imgs/labroom_management/edit-schedule.webp"><li><img alt="Screenshot Computer Management"src="/imgs/labroom_management/computer_mng.webp"><li><img alt="Screenshot Setting Software"src="/imgs/labroom_management/setting-software.webp"></ul></section></main><footer><h3>Tôn Thất Phu Nhật Minh</h3><nav><a href="/index.html">Home</a> <a href="/index.html#about">About</a> <a href="/index.html#skills">Skills</a> <a href="/projects.html">Projects</a> <a href="/index.html#contacts">Contacts</a></nav><p>Email: <a href="mailto:contact@minhton.dev">contact@minhton.dev</a><p>Phone: <a href="https://zalo.me/0915682176">+84 915682176</a><p>Location: <a href="https://maps.app.goo.gl/DMbT3amH4Zozn8jY9">Ho Chi Minh City, Việt Nam</a><p>Social: <a href="https://www.youtube.com/@IkuraIsCoding">YouTube</a> | <a href="https://www.facebook.com/TTPNMinh/">Facebook</a> | <a href="https://github.com/IkMinhTon">GitHub</a> | <a href="https://www.tiktok.com/@ikuraiscoding">TikTok</a><p>© June 17, 2025 Minh Ton – All Rights Reserved.</footer>
